import React from "react";
import { FormControl, InputLabel, Select, withStyles } from "@material-ui/core";

const styles = theme => ({
  formControl: {
    margin: theme.spacing.unit,
    width: 200
  }
});

export default withStyles(styles)(
  ({ classes, values, handleChange, selection, data }) => {
    return (
      <FormControl className={classes.formControl}>
        <InputLabel>{data}</InputLabel>
        <Select
          native
          multiple
          value={selection}
          onChange={handleChange("discTypeSelector")}
          inputProps={{
            name: data,
            id: `${data}-native-simple`
          }}
        >
          <option value="" />
          {values.map(value => (
            <option value={value} key={values.indexOf(value)}>
              {value}
            </option>
          ))}
        </Select>
      </FormControl>
    );
  }
);
